import React from 'react';

const Navigation = ({ onRouteChange }) => {
	return (
		<nav className='flex justify-end'>
		<p 
		onClick={()=>onRouteChange('Signin')}
		className='dim pointer'> sign out </p>
		</nav>
	);
}

export default Navigation;
